INSERT INTO `article` (`id`, `create_dt`, `update_dt`, `name`, `title`, `body`) VALUES
(1, '2017-06-29 13:57:12', '2017-06-29 14:30:45', 'about', 'О компании', '<p class=\"ql-align-justify\">Миссией компании «ТЕРА-ИНВЕСТ» является осуществление оперативных поставок качественного сырья, в том числе комбинаций сырья, по наилучшим ценам для потребностей различных производств в России, странах ближнего и дальнего зарубежья с решением задач по транспортировке сырья до клиентов.</p><p class=\"ql-align-justify\">Компания «ТЕРА-ИНВЕСТ» за время поставок зарекомендовала себя как надежный поставщик, о чем свидетельствует удовлетворенность наших клиентов, среди которых ведущее место занимают различные производства, которые мы регулярно и точно в срок снабжаем сырьем проверенного качества.</p><p class=\"ql-align-justify\">Команда компании «ТЕРА-ИНВЕСТ» постоянно работает над расширением поставляемой товарной номенклатуры включением в нее продуктов, качество которых соответствует требованиям производителей. Мы увеличиваем количество складов в различных городах России, с которых возможна отгрузка продукции.</p><p class=\"ql-align-justify\">Команда компании «ТЕРА-ИНВЕСТ» импортирует сырье напрямую, закупает непосредственно на заводах-изготовителях, а также сотрудничает с официальными дилерами заводов-изготовителей.</p><p class=\"ql-align-justify\">Мы сотрудничаем: </p><p class=\"ql-align-justify\">ОАО «ОСВ Стекловолокно» (Россия) (подразделение «<a href=\"https://www.owenscorning.com/\" target=\"_blank\" style=\"color: windowtext;\">Owens&nbsp;Corning</a>» (США))</p><p class=\"ql-align-justify\">«Jushi Group Co., Ltd» (Китай)</p><p class=\"ql-align-justify\">«<a href=\"http://www.kpb.co.kr/eng/\" target=\"_blank\" style=\"color: windowtext;\">Kumho P&amp;B Chemicals</a>» (Южная Корея)</p><p class=\"ql-align-justify\">«Heze Yongsheng Chemical Co., Ltd» (Китай)</p><p class=\"ql-align-justify\">«Inovyn» (Франция)</p><p class=\"ql-align-justify\">«<a href=\"http://www.npc.com.tw/\" target=\"_blank\" style=\"color: windowtext;\">Nan-Ya&nbsp;Plastics&nbsp;Corp.</a>» (Тайвань)</p><p class=\"ql-align-justify\">«<a href=\"http://yandex.ru/clck/jsredir?from=yandex.ru%3Bsearch%2F%3Bweb%3B%3B&amp;text=&amp;etext=1310.W0IkBpT8EWdeGHLIR2QjMd32X7r7t2OFH2YnzQPdd7VWDmMjLTkGJm9PNWhuPStTFERQdRZakWurtIlcdXcOvw.a08375dd5872f18691d9b20e8b5a257ac5594035&amp;uuid=&amp;state=PEtFfuTeVD5kpHnK9lio9QkU1tHIaqSGmpn3NHuF9ZhormuAhRpp2Hg0NWWfgL1y6yQWQeUOQOx8WCQ4t5MEku1xQ5SaVPHKHQEj3oekgeiEmLFo7aWkjA&amp;data=UlNrNmk5WktYejR0eWJFYk1LdmtxdTZjTXRjdnBheTczLVlQOXBYYXVOTHFPMkhnd2dXa1I5TW9QZW1mUTI1RjBXVHFKaTFoZHRzMTlvMnh2dzlCVFgxdzM4N05wX0ZqVFl6UkZLajNNT0k&amp;b64e=2&amp;sign=5dadb1a5b6d4aacd96bce6c02bca361e&amp;keyno=0&amp;cst=AiuY0DBWFJ4CiF6OxvZkNOJ3GXjAPkolWUjfnl_cqsBxx1uE_Mt9m04bF1Vb1zsvDlSg0EuPGkTbyEgxcnt0Z2GgZIbgoiW9bxUImfXPhg5ZU06y7U5lXV6nQBIMo0PhEXoGbIwmeFgBJe6Rk5bEtPaGJFht32SzcA_3q3iGBlJV9N4_twTLeHYkxJ_WJbv5Rj2Qsxpa0vvzDUZJH5_xxVmyAq2kyNYVh-sg4sjQRgC42Nhcz-wugRaQk4uzFZ2KmFST1e_HJDHguM8ZVubnazUtafrBwDtYB2780hvC5CI-JnIek37XE-bOflStbvgWX1ZTAiC62-HuIEzKhCrZIBRu8TD_crJtmPvsYMhJ_tHA51NbNfbkw-lqBGCrhly5XLzFP3rk_WuSA0vHcXSGwOEa-5VHZ5T7wq4zfXKzJaw54lywlQmlvuBuj9xP897uxMAYdS_ROjCwkFntHflgqkaIL_0GsHjCxgEoLlP1t1aSXyJ6D7XRX1eKICsd1dNEj4he0PfN9S65te7E6zSaw85AMepHHQdoSZ8vMKjNkTZ1GEl6E8WLdmKHeOQKhmpoq_ZbR0rj5uh9QaWO14Jd8ERPV4JsQ8vKVV-n7N9-hS8buNOVl6hhB95sAbQWSF72UgSxAfh9ZDthE3WAs_9Otg7zfm_Z-1RwPI_KF4ygbXwaQTxI-nKwTBFv9keUvlveRWusexwHFdYi4JLcEKDkBOzJqKR4x_NlZXRSTeOYFlxd2V0MTjCdtw&amp;ref=orjY4mGPRjk5boDnW0uvlrrd71vZw9kpVBUyA8nmgRFKPoSpDebE7ORuei1Lk5w7ldFUHjJiS1-Hs2UE-kzR6LHq9FQcp26W3EcFvPRer6D_tVJZh9q2nmKJuL_Pp90OFKReh1gzeR7b9PT4okQ15kEkqIufxct2imPdFmVCAT690zTZqT7MhA&amp;l10n=ru&amp;cts=1485246505282&amp;mc=1\" target=\"_blank\" style=\"color: windowtext;\">ФКП&nbsp;Завод&nbsp;им. Я.М. Свердлова</a>» (Россия)</p><p class=\"ql-align-justify\">«SRF Limited» (Индия)</p><p class=\"ql-align-justify\">«Befar» (Китай)</p><p class=\"ql-align-justify\">«Hanwha Chemical Corporation» (Южная Корея)</p><p class=\"ql-align-justify\">«Dakang» (Китай)</p><p class=\"ql-align-justify\">и другими.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">Преимущества, которые Вы получаете при сотрудничестве с нами:</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">1. Гарантия низких цен. </p><p class=\"ql-align-justify\">Мы стабильно закупаем сырье крупным оптом, поэтому у нас низкие цены и длительные сроки годности сырья, что позволяет применять его в течение продолжительного времени.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">2. Наличие сырья на складах.</p><p class=\"ql-align-justify\">Мы реализуем исключительно то сырье, которое находится непосредственно в наличии.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">3. Сырье надлежащего качества и требуемого количества. </p><p class=\"ql-align-justify\">Так как наша компания совершает регулярные закупки, то поставляемое нами сырье проверенного качества. В связи с тем, что заводы-изготовители отпускают сырье крупным оптом, это требует на закупку отвлечения большой части оборотных средств. Наша компания реализует сырье в том количестве, которое необходимо Вам.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">4. Комплексные поставки сырья. </p><p class=\"ql-align-justify\">Вы можете приобрести все необходимые виды сырья для нужд Ваших производств в нашей компании, что сокращает логистические и затраты и экономит Ваше время.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">5. Экономия на логистике. </p><p class=\"ql-align-justify\">Так как мы ежедневно организуем транспортировки сырья до наших клиентов, то наша компания обладает необходимым опытом по организации логистики, что приводит к снижению затрат наших клиентов на доставку. Мы осуществляем доставку в максимально сжатые сроки.</p><p>	</p><p>6. Склады в различных городах России.</p><p class=\"ql-align-justify\">Количество складов в различных городах России, с которых возможна отгрузка продукции, увеличивается, что ведет к снижению расстояния между складом отгрузки и адресом клиента, что в свою очередь снижает затраты на транспортировку.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">7. Сервис 24/7. </p><p>Наши менеджеры на связи с Вами 24 часа 7 дней в неделю. Доступны следующие виды коммуникации: сотовая связь, электронная почта, различные мессенджеры (WhatsApp, Viber, ICQ). Наши менеджеры всегда рады проконсультировать Вас по поставляемым продуктам. Ваш персональный менеджер всегда будет информировать Вас относительно того на какой стадии находится поставка сырья в Ваш адрес.</p>');

