INSERT INTO `category` (`id`, `list_position`, `catalogue_id`, `parent_id`, `name`, `description`, `meta_desc`, `meta_keys`, `icon`) VALUES
(1, 3, 1, NULL, 'Эпоксидные смолы', '<p><span class=\"ql-size-large\">Э</span>поксидная смола – продукт синтетического происхождения, получаемый в результате поликонденсации эпихлоргидрина в сочетании с фенолами. Данный материал отличается универсальностью, что определяет широкую сферу его использования: из всех видов смол только эпоксидная используется так часто при производстве материалов композитного состава. Высокая востребованность продукции данного вида неслучайна, так как именно эпоксидная смола дает лучшие результаты по прочности и иным качественным параметрам, сохраняя привлекательную цену и доступность.</p>', 'Эпоксидная смола', 'смола,эпоксидная', NULL),
(2, 4, 1, NULL, 'Отвердители', '<p><strong><em>О</em></strong>твердитель – соединение особого вида, вводимое в небольших дозах в отделочные и строительные материалы, а также в эпоксидную смолу. Такие соединения предназначены для перевода основного материала в твердую форму. В случае с эпоксидной смолой отвердители используются для полимеризации, при этом процесс перевода пластичной смолы в твердое состояние может происходить как с нагревом смеси, так и без него.</p><p>Различные типы отвердителей могут состоять из разнообразных соединений: амины, ангидриды, перекись бензоила, кислоты разного типа.</p>', 'Отвердители', 'отвердитель', NULL),
(3, 5, 1, NULL, 'Ускорители и пластификаторы', '<p>В роли добавок и катализаторов для эпоксидных смол выступают вещества, добавляемые в малых дозах эпоксидную смолу с отвердителем, что стимулирует ускорение протекающих реакций. Точная дозировка добавок определяется потребностью в конечных свойствах, которыми будет обладать конечный продукт. Применение ускорителей оправдано при значительных объемах выполняемых работ и небольших сроках на их проведение. Равно как при использовании в составе долготвердеющей эпоксидной смолы.</p><p><br></p>', 'Ускорители и пластификаторы', 'ускоритель, пластификатор', NULL),
(5, 6, 1, NULL, 'Стеклоровинг', '<p class=\"ql-align-justify\"><strong style=\"color: black;\">Стеклоровинг </strong><span style=\"color: black;\">или просто ровинг — это привычное </span><strong style=\"color: black;\">стекловолокно</strong><span style=\"color: black;\"> в виде нитей, смотанное в бобины и упакованное в прозрачную пленку. Широко применяется при изготовлении продукции из стеклопластика, например, стеклотканей или стекломатов. Ровинг различается по плотности, может быть рассыпающимся или прямым. Плотность стеклоровинга измеряется в tex и может варьироваться от 200 до 9600. Чем больше нитей в бобине, тем выше плотность. &nbsp;</span></p><p><span style=\"color: black;\">Мы не рекомендует распаковывать ровинг до непосредственной эксплуатации. Хранить его следует в сухом прохладном помещении, избегая прямых солнечных лучей, повышенной влажности и экстремально низких температур. Приобретая </span><strong style=\"color: black;\">стеклоровинг, цена</strong><span style=\"color: black;\"> на который всегда доступна, вы получаете высокотехнологичный современный материал с великолепными эксплуатационными характеристиками.</span></p><p><br></p><p><strong style=\"color: black;\">Где купить стекловолокно&nbsp;</strong></p><p><br></p><p><span style=\"color: black;\">В нашем магазине вы можете </span><strong style=\"color: black;\">купить ровинг </strong><span style=\"color: black;\">по доступной цене. Вся продукция сертифицирована и соответствует мировым стандартам качества. Приобретая </span><strong style=\"color: black;\">стекловолокно</strong><span style=\"color: black;\"> у нас вы, как покупатель, получаете множество преимуществ. Наша ключевая особенность — сочетание доступной цены и высокого качества нашей продукции.</span></p><p><span style=\"color: black;\">3 причины, почему вы можете нам доверять:</span></p><ul><li><span style=\"color: black;\">Высокое качество продукции</span></li></ul><p class=\"ql-indent-1\"><span style=\"color: black;\">Вся продукция, представленная в нашем каталоге, изготавливается на крупнейших заводах и проходит множество проверок перед тем, как попасть в руки к потребителю. Мы гарантируем непревзойденное качество и долговечность всей продукции.</span></p><ul><li><span style=\"color: black;\">Оптимальные цены</span></li></ul><p class=\"ql-indent-1\"><span style=\"color: black;\">Благодаря большому количеству покупателей нам незачем повышать цены на свою продукцию, помимо этого мы предлагаем вам периодические акции и спецпредложения, с помощью которых вы можете значительно сэкономить при покупке ровинга.</span></p><ul><li><span style=\"color: black;\">Быстрые поставки</span></li></ul><p class=\"ql-indent-1\"><span style=\"color: black;\">Большинство из позиций в каталоге есть в наличии, но если необходимый материал отсутствует, будьте уверены, мы доставим его в ближайшие сроки специально для вас. Мы ценим ваше время и потому обеспечиваем максимально быстрые поставки.</span></p><p class=\"ql-indent-1\"><br></p><p><span style=\"color: black;\">Возникли вопросы? Свяжитесь с нами по электронной почте или по телефону, указанному на сайте (звонок бесплатный). Наши менеджеры ответят на интересующие вас вопросы, проконсультируют в выборе и подберут необходимую продукцию по оптимальной цене. У нас вы можете </span><strong style=\"color: black;\">заказать ровинг </strong><span style=\"color: black;\">и убедиться лично в качестве продукции!</span></p>', 'Купить стеклоровинг (стекловолокно) по оптимальным ценам', 'Ровинг, стекловолокно, стеклоровинг', NULL),
(11, 2, 1, NULL, 'Перхлорэтилен', '<p><strong>Перхлорэтилен (тетрахлорэтилен)</strong>&nbsp;- универсальный растворитель, который широко применяется в химчистке и обезжиривании металлов в машиностроении, приборостроении, при обработке фотополимерных печатных плат, в производстве игл к одноразовым шприцам, в текстильной, деревообрабатывающей промышленности, в производстве фреонов и активных красителей в <strong>%city_pp%</strong>.</p><p><br></p>', 'Перхлорэтилен (тетрахлорэтилен) - универсальный растовритель', 'Перхлорэтилен, тетрахлоэтилен', NULL),
