(29, 10, 1, NULL, 'Смазочно-охлаждающая жидкость (СОЖ)', '<h1><strong>СПРАВОЧНАЯ ИНФОРМАЦИЯ О СОЖ</strong></h1><p>Для современных процессов обработки материалов наряду с использованием оборудования, заготовок, режущего инструмента, основным из факторов обеспечения качества является СОЖ.</p><p>СОЖ – представляет собой сбалансированную смесь минерального масла ,эмульгаторов и ингибиторов коррозии, которая при смешивании с водой образует мелкодисперсные эмульсии.</p><p>Основное назначение СОЖ - снижение температуры в зоне резания, снижения износа режущего инструмента, обеспечение необходимого качества обработанной поверхности и повышение производительности.</p><p>Наша фирма совместно с рядом предприятий Дзержинского промышленного комплекса (г. Дзержинск Нижегородской обл), выпускает полусинтетическую смазочно – охлаждающую жидкость «СИНТЕК-02М» и «СИНТЕК-03» , для операций лезвийной, абразивной, токарно – фрезерной, режущей обработках черных металлов, сплавов алюминия, меди, как на индивидуальных станках, так и на автоматических линиях.</p><p>Наша продукция прошла успешные испытания и применяется на мощностях структур холдинг «Русские машины» (ОАО «Павловский автобус»), Чебоксарский агрегатный завод, Корпорация боевых тактических ракет, «РосАтом», ОАО «Заволжский Моторный Завод», ОАО «ГосНИИмаш», ФКП «Завод им. Я.М. Свердлова», Концерн Тракторные Заводы, ОАО «ОКБМ им. И.И. Африкантова», ООО «ЛЕСТЕХКОМ», ООО «ЭнергоПромСервис – НН» и тд.</p><p><strong>СОЖ «Синтек-02М»</strong>&nbsp;является одним из лучших представителей СОЖ российского производства . Она практичная и недорогая. Может заменять такие торговые марки как: Велс-1, Велс-1М,Укринол 1, Эмулькат, Ивкат, Инкам, Техмол – 1, Эфтол, СНПХ-3М, Аквол-6, Вексанол-5, Автокат-78, Сульфогал, Укрино 5/5, Экол Б6, Экол Б2, Эксол, Караидель, Ока, Борамин и тд.</p><p><strong>СОЖ «Синтек-03»</strong>&nbsp;является российским ответом западным СОЖ. Она разработана с применением иностранных инноваций, обеспечивающих значительный рост эффективности нашей жидкости.. В ее основу легли технологии ведущих зарубежных марок СОЖ. Качественные показатели СОЖ \"Синтек-03\" не уступают торговым маркам Houghton Shell Sitala, Dromus, Blaser Swisslube, MODUS-MS, MODUS-MS1, MODUS-M, MODUS-M1, CASTROL, RATAK, Mobilcut, однако значительно выигрывают по цене в 3-5 раз и позволят Вам снизить расходы без потерь качества обработки.</p><h4><strong>ПРЕИМУЩЕСТВА НАШЕЙ ПРОДУКЦИИ:</strong></h4><ul><li>отвечает гигиеническим и экологическим требованиям;</li><li>обладает моющими свойствами;</li><li>отвечает требованиям утилизации и содержанию вредных веществ;</li><li>обладает стойкостью к микробопоражению и антикоррозионными свойствами.</li><li>отличается низким пенообразованием;</li><li>расширенный срок эксплуатации СОЖ за счет эффективных бактерицидов;</li><li>позволяет снизить затраты времени на приготовление эмульсии.</li></ul><p><br></p>', 'Смазочно-охлаждающая жидкость, СОЖ', 'Смазочно-охлаждающая жидкость, СОЖ', NULL),
