INSERT INTO `product` (`id`, `name`, `description`, `meta_desc`, `meta_keys`, `manufacturer_id`) VALUES
(4, 'Эпоксидная смола \"Kumho\" KER 828 (Южная Корея)', '<p>Основу материала составляет бисфенол. KER 828 не воспламеняется, горит при температуре 150°С. В составе смолы отсутствуют растворители, на нее не действует водная среда, растворение возможно лишь с использованием органических составов. Широкая сфера использования обеспечивается в силу его качественных характеристик. KER 828 хорошо скрепляет любые материалы, используется как герметик, не портится со временем и не разрушается под действием ржавчины. Даже спустя много лет он не подвержен износу и не дает усадку. Данная марка продукции после выпуска разливается в металлические бочки разной вместимости, в которых смола хорошо хранится и перевозится. Хранение материала должно происходить в плотно закрытой таре, бочки располагаются на сухих складах с системой вентиляции. Непосредственная работа с эпоксидной смолой KER 828 должна проводиться в защитных костюмах, с использованием масок или респираторов. Наша компания организует поставку смолы KER 828, а также иных видов качественных материалов в необходимых объемах.</p>', 'Эпоксидная смола', 'Эпоксидная смола, ЭД-20', 1),
(5, 'Изометилтетрагидрофталевый ангидрид, изометил (MTHPA), ИзоМТГФА (Китай)', '<p>В качестве основных потребителей ИМТГФА выступают заводы электротехники, специализирующиеся на выпуске изоляционных материалов. На производствах такого типа эпоксидная смола применяется для изготовления разного рода изолирующих покрытий, поэтому изометил необходим здесь в больших количествах. Компании, занятые производством стеклопластиков и стеклоткани на основе эпоксидных смол, также выступают крупнейшими потребителями ИМТГФА. Не менее востребован материал и на небольших производствах – при выпуске арматуры, наливных полов, стеклопластиковых труб. Изометил был синтезирован не так давно, однако практически сразу нашел широкое применение в производстве техники с использованием современных технологий. С его помощью склеивают мельчайшие частицы механических изделий и электроники. Материал также широко востребован как качественный герметик, склеивающий компонент.</p><p>Компания «ТЕРА-ИНВЕСТ» предлагает купить большой выбор отвердителей для эпоксидных смол, производимых известными мировыми брендами. У нас можно сделать заказ на продукцию в любом количестве по выгодной цене.</p>', '', '', 2),
(6, 'Ровинг, стекловолокно \"Jushi\" (Китай)', '<p>Стеклоровинги представляют собой универсальные изделия, пропитанные силановым замасливателем, что позволяет использовать их с различными типами смол. Отдельные замасливатели, используемые для различных марок ровинга, отличаются наличием специальных добавок, уменьшающих уровень пушения стеклоровинга. Cтеклоровинг выпускается в качестве спецпродукта для намотки, совместимого с различными видами смол, включая эпоксидную. Материал отличается низким пушением, устойчив к истиранию, хорошо пропитывается смолой. Cтеклоровинг представляет продукт, разработанный специально для производства методом пултрузии и ткачества. Использование силанового замасливателя делает данный тип ровинга совместимым с разными видами смол. Материал рекомендован производителем в качестве основного при изготовлении стеклопластиковой арматуры, профиля, геосеток. Cтеклоровинг представляет собой стекловолокно с модифицированным силановым замасливателем, находящее основное применение в изготовлении экструзионным методом стеклонаполненных полиамидов. Материал подходит для различного оборудования, выступает составной частью полиамидов, применяемых в производстве электроники, спорттоваров, химпромышленности.</p>', '', '', NULL),
(7, 'Ровинг, стекловолокно ОАО \"ОСВ Стекловолокно\" (Россия)', '<p>Ровинг для пултрузии представлен прямым и ассемблированным стекловолокном, отличающимся хорошей производительностью в пультрузии при совместном применении с термореактивными смолами. Данный метод используется для изготовления разнообразных видов промышленного профиля. Ровинг для намотки представлен ассемблированными марками, позволяющими достичь отличной производительности при намотке. Процесс сопровождается применением обычной системы термореактивных смол и позволяет выпускать емкости разной вместимости, трубы и другие изделия для промышленных областей, в которых небольшой вес продукции играет важную роль. Готовые изделия отличаются устойчивостью к ржавчине, высокому давлению и температуре, обладают свойствами диэлектрика.</p><p>Крученый ровинг используется для создания сложных экструзионных профилей с однородной структурой. Основные параметры таких изделий – отличное качество поверхности, управляемое распределение стекла/смолы. Ровинг для рубки отличается хорошим распределением волокон в пряди, обеспечивает легкость размотки и рубки, не пушится. Ровинг для напыления применяется в изготовлении композитных материалов методом напыления в сочетании с винилэфирной и полиэфирной смолой. Данная марка ровинга используется в морской промышленности, при изготовлении изделий для отдыха, сантехники и емкостей различного назначения.</p>', 'Ровинг, стекловолокно', 'Ровинг, стекловолокно', 4),
(8, 'Алкофен, DMP-30 (Китай)', '<p>Ускоритель Алкофен является катализатором-отвердителем. Его используют в качестве основной пропитки для пучков из базальтового и стекловолоконного ровинга. Подготовка связующего агента происходит в дозаторе-смесителе, после чего состав подается на поточную линию, где выполняется пропитка уже сформированных стержней. Полимеризация с участием Алкофена осуществляется в специальных печах. После остывания материала производимая арматура приобретает конечные характеристики и форму. Компания «ТЕРА-ИНВЕСТ» осуществляет поставки популярных добавок и катализаторов, используемых для ускорения полимеризации эпоксидных смол либо для придания готовому составу новых свойств. У нас можно приобрести необходимые материалы от производителей по доступным ценам.</p><p>Мы сотрудничаем с компаниями из разных регионов, предлагая выгодные варианты оплаты и доставки широкого ассортимента продукции. Все материалы обладают необходимыми сертификатами, <strong>%city_pp%</strong> отвечают высоким качественным стандартам.</p>', 'Алкофен, DMP-30', 'Алкофен, DMP-30', 8),
(9, 'Полиэтиленполиамин (ПЭПА) (Япония, Россия, Голандия)', '<p>Полиэтиленполиамины представляют собой смесь аминов различной молекулярной массы. Применяются для производства ионообменных смол, присадок, в качестве отвердителей эпоксидных смол и для других целей.</p>', 'Полиэтиленполиамин, ПЭПА', 'Полиэтиленполиамин, ПЭПА', NULL),
(10, 'Смола эпоксидная алифатическая марки ДЭГ-1 (пластификатор) (Россия)', '<p>Эпоксидная смола в качестве связующего агента проявляет при изготовлении стекловолокна повышенную вязкость, в результате чего конечная продукция получается чересчур жесткой. Уменьшить вязкость состава, а также придать стеклопластику нужную пластичность позволяет использование подходящего пластификатора. Чаще всего это диоктилфталат, либо дибутилфталат, но такие пластификаторы имеют ряд негативных характеристик, среди которых – неспособность образовывать хим. связь с отвердителями. Со временем молекулы таких пластификаторов уходят из стеклопластика, после чего конструкция становится жесткой и хрупкой, быстро старится и трескается.</p><p>Указанная проблема решается путем добавления пластификатора ДЭГ-1. В процессе молекулы вещества гармонично подстраиваются под молекулярную структуру общего состава, обеспечивая ей требуемую эластичность. Миграция молекул ДЭГ-1 со временем не происходит, это положительно отражается на сроке использования стеклопластика.</p><p>При смешивании продукта с ЭД-20 соблюдается пропорция в 5-10%.</p><p>Использование данного пластификатора обладает массой плюсов:</p><ul><li>Для работы с ним не требуется особых навыков.</li><li>Перемешивание состава происходит за короткое время и не требует подогрева.</li><li>Пластификатор не испаряется со временем.</li></ul><p>Заказать необходимое количество продукции данного вида предлагает компания «ТЕРА-ИНВЕСТ».</p>', 'ДЭГ-1, пластификатор', 'ДЭГ-1, пластификатор', 5),
(11, 'Перхлорэтилен (Индия)', '<p><strong style=\"color: inherit;\"><u>Компания производитель:</u></strong>&nbsp;SRF Limited (Индия)</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p><span style=\"color: inherit;\">Бесцветная жидкость с резким запахом, хлорорганический растворитель. Не горюч, невзрывоопасен и не самовоспламеняется. Растворим в большинстве органических растворителей.&nbsp;</span></p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li>химическая чистка;</li><li>растворитель для органических химикатов;</li><li>очищение и обезжиривание металлов (подготовка металлических поверхностей для цинкования, анодного оксидирования, гальванического покрытия, покраски и связывания);</li><li>производство фторуглеродов, триклозана, гексахлорэтана;</li><li>производство фотополимерных печатных плат;</li><li>производство игл;</li><li>текстильная и деревообрабатывающая промышленность;</li><li>растворители для удаления краски, пятновыводители.</li></ul><p><strong style=\"color: inherit;\"><u>Условия хранения:</u> </strong><span style=\"color: inherit;\">Хранить в холодном, сухом, хорошо проветриваемом помещении, вдали от источников тепла и несовместимых веществ.</span></p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong><span style=\"color: inherit;\"> Продукт упакован в стальные 200л бочки по 330 кг нетто, по желанию заказчика может быть поставлен в пластиковых бочках и канистрах, а также в танк-контейнерах</span></p><p><span style=\"color: inherit;\">Номер UN 1897</span></p><p><span style=\"color: inherit;\">Класс опасности 6.1</span></p><p><span style=\"color: inherit;\">Группа упаковки III</span></p><p><strong style=\"color: inherit;\"><u><img src=\"http://www.xn--d1aalata.xn--p1ai/admin/uploads/image/%D0%B1%D0%BE%D1%87%D0%BA%D0%B8%20%D0%9F%D0%A5%D0%AD_(2).png\" height=\"309\" width=\"625\"></u></strong></p>', 'Перхлорэтилен (тетрахлорэтилен) применяется как растворитель в химчистке и при обезжиривании металлов', 'Перхлорэтилен, растворитель, тетрахлорэтилен', 6),
(12, 'Трихлорэтилен (Китай)', '<p><strong style=\"color: inherit;\"><u>Компания производитель:</u></strong>&nbsp;Dakang (Китай)</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p><strong style=\"color: inherit;\"><u>Бесцветная, прозрачная, подвижная, летучая жидкость со своеобразным запахом, напоминающим запах хлороформа. Практически нерастворим в воде, не горюч и не взрывоопасен, смешивается с органическими растворителями.</u></strong></p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li>производство фторуглеродов (ГФУ 134а);</li><li>очищение и обезжиривание металлов, подготовка металлических поверхностей для цинкования, анодного оксидирования, гальванического покрытия, покраски и связывания;</li><li>растворитель для масел и жиров;</li><li>наркозное средство;</li><li>обработка тканей.</li></ul><p><strong style=\"color: inherit;\"><u>Условия хранения:</u></strong></p><p><strong style=\"color: inherit;\"><u>Хранить в холодном, сухом, хорошо проветриваемом помещении, вдали от источников тепла и несовместимых веществ.</u></strong></p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong></p><p><strong style=\"color: inherit;\"><u>Продукт упакован в стальные 200л бочки по 300 кг нетто, по желанию заказчика может быть поставлен в пластиковых бочках и канистрах, а также в танк-контейнерах</u></strong></p><p><strong style=\"color: inherit;\"><u>Номер UN 1710</u></strong></p><p><strong style=\"color: inherit;\"><u>Класс опасности 6.1</u></strong></p><p><strong style=\"color: inherit;\"><u>Группа упаковки III</u></strong></p>', 'Трихлорэтилен', 'Трихлорэтилен', 13),
(13, 'Перхлорэтилен (Китай)', '<p><strong style=\"color: inherit;\"><u>Компания производитель:</u></strong>&nbsp;Китай</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p><span style=\"color: inherit;\">Бесцветная жидкость с резким запахом, хлорорганический растворитель. Не горюч, невзрывоопасен и не самовоспламеняется. Растворим в большинстве органических растворителей.&nbsp;</span></p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li>химическая чистка;</li><li>растворитель для органических химикатов;</li><li>очищение и обезжиривание металлов (подготовка металлических поверхностей для цинкования, анодного оксидирования, гальванического покрытия, покраски и связывания);</li><li>производство фторуглеродов, триклозана, гексахлорэтана;</li><li>производство фотополимерных печатных плат;</li><li>производство игл;</li><li>текстильная и деревообрабатывающая промышленность;</li><li>растворители для удаления краски, пятновыводители.</li></ul><p><strong style=\"color: inherit;\"><u>Условия хранения:</u> </strong><span style=\"color: inherit;\">Хранить в холодном, сухом, хорошо проветриваемом помещении, вдали от источников тепла и несовместимых веществ.</span></p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong><span style=\"color: inherit;\"> Продукт упакован в стальные 200л бочки по 330 кг нетто, по желанию заказчика может быть поставлен в пластиковых бочках и канистрах, а также в танк-контейнерах</span></p><p><span style=\"color: inherit;\">Номер UN 1897</span></p><p><span style=\"color: inherit;\">Класс опасности 6.1</span></p><p><span style=\"color: inherit;\">Группа упаковки III</span></p>', 'Перхлорэтилен', 'Перхлорэтилен', NULL),
(14, 'Оксиэтилидендифосфоновая кислота (ОЭДФ) 98% (Китай)', '<p><strong style=\"color: inherit;\"><u>Страна производитель:</u></strong>&nbsp;Китай</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p>Оксиэтилидендифосфоновая кислота - представляет собой порошок белого цвета с сероватым или бежевым оттенком, хорошо растворима в воде, кислотах, щелочах, этаноле, метаноле.</p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><p>- в нефтедобывающей и энергетической промышленности в качестве ингибитора солеотложений;</p><p>- в качестве ингибитора солеотложений для систем горячего водоснабжения с открытым водозабором;</p><p>- в химической и текстильной промышленности в качестве комплексообразующего реагента;</p><p>- в качестве комплексообразующего реагента, ингибитора солеотложений в водооборотных системах охлаждения промышленных предприятий и тепловых электростанций, в замкнутых системах теплоснабжения, в системах горячего водоснабжения, а также в качестве реагента для отмывки солеотложения на различных промышленных объектах;</p><p>- в целлюлозно-бумажной промышленности в процессе отбелки целлюлозы всех видов на стадии хелатации.</p><p><strong style=\"color: inherit;\"><u>Условия хранения:</u></strong></p><p>Хранить в крытых, сухих помещениях.</p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong></p><p>Мешки по 25 кг</p><p>Класс опасности: 8</p><p>Группа упаковки: III</p><p>UN 3265</p>', 'Оксиэтилидендифосфоновая кислота, ОЭДФ', 'Оксиэтилидендифосфоновая кислота, ОЭДФ', 8),
(15, 'Ортофосфорная кислота 85% (Китай)', '<p><strong style=\"color: inherit;\"><u>Страна производитель:</u></strong><span style=\"color: inherit;\">&nbsp;Китай</span></p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p><span style=\"color: inherit;\">Ортофосфорная кислота - неорганическая кислота, представляет собой бесцветную жидкость сиропообразной консистенции без запаха. Очень хорошо растоворяется в воде и органических растворителях.</span></p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li><span style=\"color: inherit;\">очищение от ржавчины металлических поверхностей;</span></li><li><span style=\"color: inherit;\">производство минеральных удобрений;</span></li><li>в составе фреонов (в промышленных холодильных установках);</li><li>в производстве бытовых моющих средств.</li></ul><p><strong style=\"color: inherit;\"><u>Условия хранения:</u></strong></p><p>Хранить в сухом, холодном, хорошо проветриваемом помещении</p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong></p><p>Продукт упакован в пластиковые бочки по 330 кг нетто и пластиковые канистры по 35 кг нетто</p><p>Класс опасности 8</p><p>Группа упаковки III</p><p>UN 1805</p>', 'Ортофосфорная кислота', 'Ортофосфорная кислота', 8),
(16, 'НТФ кислота (нитрилометилтриенфосфоновая кислота) (Китай)', '<p><u style=\"color: inherit;\">Страна производитель:</u>&nbsp;Китай</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p>Нитрилометилтриенфосфоновая кислота - представляет собой белый кристалический порошок, является горючим веществом, хорошо растворима в воде, кислотах, щелочах и не растворима в органических растворителях.</p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li>в нефтедобывающей промышленности в качестве регулятора физико-химических свойств буровых и тампонажных растворов, в качестве ингибитора солеотложения в процессах добычи нефти;</li><li>является эффективным замедлителем схватывания бетонных смесей, сохраняет их пластические свойства, снижает скорость экзотермического разогрева бетона; обладает высокой эффективностью при минимальных дозировках (от 0,03% массы цемента). Рекомендована НИИЖБ, ЦНИИС;</li><li>в строительной промышленности, в качестве замедлителя сроков схватывания бетонных смесей в производстве монолитного и сборного железобетона;</li><li>в теплоэнергетике в качестве ингибитора солеотложения и коррозии в различных теплообменных аппаратах, в составе средств для химической очистки оборудования от накипи;</li><li>в целлюлозо-бумажной промышленности в процессе отбелки и окраски целлюлозы всех видов на стадии хелатации;</li></ul><p><strong style=\"color: inherit;\"><u>Условия хранения:</u></strong></p><p>Хранить в крытых, сухих помещениях.</p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong></p><p>Мешки по 25 кг</p><p>Класс опасности: 8</p><p>Группа упаковки: III</p><p>UN 3261</p>', 'НТФ кислота, Нитрилометилтриенфосфоновая кислота', 'НТФ кислота, Нитрилометилтриенфосфоновая кислота', 8),
(17, 'Эпихлоргидрин (Южная Корея)', '<p><strong style=\"color: inherit;\"><u>Компания производитель:</u></strong>&nbsp;Hanwha Chemical Corporation (Корея)</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p>Бесцветная, подвижная, прозрачная жидкость с резким, неприятным, раздражающим запахом хлороформа. Химически высокореакционное легковоспламеняющеся соединение. Плохо растворим в воде и хорошо в большинстве органических растворителей.</p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li>производство синтетического глицерина;</li><li>производство стабилизаторов для хлорорганических соединений;</li><li>производство ионообменных и эпоксидных смол.</li></ul><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong></p><p>Продукт упакован в стальные бочки 230 кг нетто, по желанию заказчика может быть поставлен в танк-контейнерах</p><p>Номер UN 2023</p><p>Класс опасности 6.1</p><p>Группа упаковки II</p>', 'Эпихлоргидрин', 'Эпихлоргидрин', 9),
(18, 'Смазочно-охлаждающая жидкость (СОЖ) \"СИНТЕК-03М\" (Россия)', '<p>Продукт:<strong>&nbsp;Смазочно-охлаждающая жидкость (СОЖ)&nbsp;«СИНТЕК-03М»</strong></p><h4><strong>ТУ 0258-124-07510508-2013</strong></h4><p>Настоящие технические условия распространяются на концентрат водосмешиваемой полусинтетической смазочно – охлаждающей жидкости «Синтек-03М», предназначенный для приготовления водных 3-10% микроэмульсий, в качестве технологической среды на операциях лезвийной, абразивной, токарно – фрезерной, режущей обработки черных и цветных металлов, сплавов алюминия, стали, меди, как на индивидуальных станках, так и на автоматических линиях.</p><p><strong>Аналоги</strong>: Houghton Shell Sitala, Dromus, Blaser Swisslube, MODUS-MS, MODUS-MS1, MODUS-M, MODUS-M1, CASTROL, RATAK, Mobilcut</p><p><strong>Фасовка</strong>: металлические бочки 200 кг или канистры по 10 кг.</p><p><strong>Доставка</strong>: по всей России. Работаем с любыми транспортными компаниями.</p><p><strong>Гарантийный срок хранения: 12 месяцев.</strong></p>', 'Смазочно-охлаждающая жидкость, СОЖ, \"СИНТЕК-03М\"', 'Смазочно-охлаждающая жидкость, СОЖ, \"СИНТЕК-03М\"', 10),
(19, 'Смазочно-охлаждающая жидкость \"СИНТЕК-02М\" (Россия)', '<p>Продукт:<strong>&nbsp;Смазочно-охлаждающая жидкость (СОЖ)</strong></p><h4><strong>ТУ 0258-085-07510508-2011</strong></h4><p>Настоящие технические условия распространяются на концентрат водосмешиваемой полусинтетической смазочно – охлаждающей жидкости «Синтек-02М», предназначенный для приготовления водных 3-10% микроэмульсий, в качестве технологической среды на операциях лезвийной, абразивной, токарно – фрезерной, режущей обработки черных металлов с целью повышения стойкости режущего инструмента и качества обрабатываемы деталей на станках – автоматах и автоматических линиях.</p><p><strong>Аналоги</strong>: Велс-1, Велс-1М,Укринол 1, Эмулькат, Ивкат, Инкам, Техмол – 1, Эфтол, СНПХ-3М, Аквол-6, Вексанол-5, Автокат-78, Сульфогал, Укрино 5/5, Экол Б6, Экол Б2, Эксол, Караидель, Ока, Борамин и тд.</p><p><strong>Фасовка:</strong>&nbsp;металлические бочки 200 кг или канистры по 10 кг.</p><p><strong>Доставка:</strong>&nbsp;по всей России. Работаем с любыми транспортными компаниями.</p><p><strong>Гарантийный срок хранения: 12 месяцев.</strong></p>', 'Смазочно-охлаждающая жидкость, \"СИНТЕК-02М\", СОЖ', 'Смазочно-охлаждающая жидкость, \"СИНТЕК-02М\", СОЖ', 10),
(20, 'Бензиловый спирт (Китай)', '', 'Бензиловый спирт', 'Бензиловый спирт', 8),
(21, 'Бензиловый спирт (Индия)', '', 'Бензиловый спирт', 'Бензиловый спирт', 11),
(22, 'Эпоксидная смола ЭД-20 (Россия)', '<p>Продукт:<strong>&nbsp;Эпоксидная смола ЭД 20</strong></p><p>Английское название:&nbsp;<strong>Epoxy resin</strong></p><p>ГОСТ:&nbsp;&nbsp;<strong>10587-84</strong></p><p>Номер CAS:&nbsp;<strong>6192-52-5</strong></p><p>Код ТНВЭД:&nbsp;<strong>3907300000</strong></p><h4><strong>ПРИМЕНЕНИЕ:</strong></h4><p>Эпоксидная смола ЭД-20 используется в электротехнической, радиоэлектронной промышленности, авиа-, судо- и машиностроении, в строительстве в качестве компонента заливочных и пропиточных компаундов, клеев, герметиков, связующих для армированных пластиков.</p><h4><strong>МЕРЫ ПРЕДОСТОРОЖНОСТИ:</strong></h4><p>Работающие со смолой ЭД-20 должны быть обеспечены спецодеждой и индивидуальными средствами защиты. Все операции при работе с эпоксидными смолами должны проводится в помещениях оборудованных приточно-вытяжной вентиляцией.</p><h4><strong>ХРАНЕНИЕ:</strong></h4><p>Cмолу ЭД-20 хранят в плотно закрытой таре в закрытых складских помещениях при температуре не выше 40°С.</p><h4><strong>ФАСОВКА:</strong></h4><p>Отгрузка эпоксидно-диановой смолы ЭД-20 производится в стальных оцинкованных барабанах. Масса нетто единицы продукции 50 кг. Также возможна фасовка эпоксидной смолы в пластиковую тару по 0,5 кг.</p>', 'Эпоксидная смола ЭД-20', 'Эпоксидная смола, ЭД-20', 5),
(23, 'Эпоксидная смола ЭД-16 (Россия)', '<p>Продукт:<strong>&nbsp;Эпоксидная смола ЭД 16</strong></p><p>Английское название:&nbsp;<strong>Epoxy resin</strong></p><p>ГОСТ:&nbsp;<strong>10587-84</strong></p><p>Номер CAS:&nbsp;<strong>6192-52-5</strong></p><p>Код ТНВЭД:&nbsp;<strong>3907300000</strong></p><h4><strong>ПРИМЕНЕНИЕ:</strong></h4><p>Эпоксидная смола используется в электротехнической, радиоэлектронной промышленности, авиа-, судо- и машиностроении, в строительстве в качестве компонента заливочных и пропиточных компаундов, клеев, герметиков, связующих для армированных пластиков.</p><h4><strong>МЕРЫ ПРЕДОСТОРОЖНОСТИ ПРИ ОБРАЩЕНИИ С ЭПОКСИДНОЙ СМОЛОЙ:</strong></h4><p>Работающие с эпоксидными смолами должны быть обеспечены спецодеждой и индивидуальными средствами защиты. Все операции при работе с эпоксидно-диановой смолой марки ЭД-16 должны проводится в помещениях оборудованных приточно-вытяжной вентиляцией.</p><h4><strong>ХРАНЕНИЕ:</strong></h4><p>Эпоксидно-диановую смолу марки ЭД-16 хранят в плотно закрытой таре в закрытых складских помещениях при температуре не выше 400С.</p><h4><strong>ФАСОВКА:</strong></h4><p>Отгрузка производится в оцинкованных барабанах. Масса нетто единицы продукции 55 кг. Также возможна фасовка эпоксидной смолы в пластиковую тару по 0,5 кг.</p><p><em>Гарантийный срок хранения эпоксидной смолы марки ЭД 16 - 12 месяцев со дня изготовления.</em></p><p>Для заказа эпоксидной смолы, пожалуйста, перейдите на страницу контактов.</p>', 'Эпоксидная смола ЭД-16', 'Эпоксидная смола, ЭД-16', 5),
(24, 'Эпоксидная смола Э-40 (Россия)', '<p>Продукт:<strong>&nbsp;Эпоксидная смола Э 40</strong></p><p>Английское название:&nbsp;<strong>Epoxy resin</strong></p><p>ТУ:&nbsp;<strong>2225-154-05011907-97</strong></p><p>Номер CAS:&nbsp;<strong>6192-52-5</strong></p><p>Код ТНВЭД:&nbsp;<strong>3907300000</strong></p><h4><strong>ПРИМЕНЕНИЕ:</strong></h4><p>Применяется для производства эмалей, лаков, шпатлевок, также используется в качестве полуфабриката для производства других эпоксидных смол, заливочных масс и клеев.</p><p>МЕРЫ ПРЕДОСТОРОЖНОСТИ:</p><p>Работающие с эпоксидной смолой Э-40 должны быть одеты в спецодежду и обеспечены индивидуальными средствами защиты. Все операции при работе должны проводится в помещениях оборудованных приточно-вытяжной вентиляцией.</p><p>ХРАНЕНИЕ: Эпоксидную смолу хранят в плотно закрытой таре в закрытых складских помещениях.</p><p>ФАСОВКА: Отгрузка смолы Э-40 производится в стальных оцинкованных барабанах. Масса нетто единицы продукции 55 кг. Также возможна фасовка эпоксидной смолы в пластиковую тару по 0,5 кг.</p><p><em>Гарантийный срок хранения эпоксидки - 18 месяцев со дня изготовления.</em></p>', 'Эпоксидная смола Э-40', 'Эпоксидная смола, Э-40', 5),
(25, 'Эпоксидная смола ЭД-22 (Россия)', '<p>Продукт:<strong>&nbsp;Эпоксидная смола ЭД 22</strong></p><p>Английское название:&nbsp;<strong>Epoxy resin</strong></p><p>ГОСТ: <strong>10587-84</strong></p><p>Номер CAS:&nbsp;<strong>6192-52-5</strong></p><p>Код ТНВЭД:&nbsp;<strong>3907300000</strong></p><h4><strong>ПРИМЕНЕНИЕ:</strong></h4><p>используется в электротехнической, радиоэлектронной промышленности, авиа-, судо- и машиностроении, в строительстве в качестве компонента заливочных и пропиточных компаундов, клеев, герметиков, связующих для армированных пластиков.</p><p>МЕРЫ ПРЕДОСТОРОЖНОСТИ:</p><p>Работающие с эпоксидной смолой должны быть обеспечены спецодеждой и индивидуальными средствами защиты. Все операции при работе с эпоксидно-диановой смолой марки ЭД-22 должны проводится в помещениях оборудованных приточно-вытяжной вентиляцией.</p><p>ХРАНЕНИЕ:</p><p>Эпоксидно-диановую смолу ЭД-22 хранят в плотно закрытой таре в закрытых складских помещениях при температуре не выше 40 0 С.</p><p>ФАСОВКА:</p><p>Отгрузка эпоксидно-диановой смолы производится в стальных оцинкованных барабанах. Масса нетто единицы продукции 55 кг . Также возможна фасовка эпоксидной смолы в пластиковую тару по 0,5 кг.</p><p><em>Гарантийный срок хранения&nbsp;эпоксидно-диановой смолы марки ЭД - 18 месяцев со дня изготовления.</em></p>', 'Эпоксидная смола ЭД-22', 'Эпоксидная смола, ЭД-22', 5),
(26, 'Эпоксидные смолы КДА, КДА-2 (Россия)', '<p>Продукт:<strong>&nbsp;Эпоксидные смолы КДА, КДА-2</strong></p><p>Английское название:&nbsp;<strong>Epoxy resin</strong></p><p>ГОСТ:&nbsp;&nbsp;<strong>10587-84</strong></p><p>ТУ:<strong>&nbsp;2225-019-75678843-2010</strong></p><p>Номер CAS:&nbsp;<strong>6192-52-5</strong></p><p>Код ТНВЭД:&nbsp;<strong>2904100000</strong></p><h4><strong>ПРИМЕНЕНИЕ:</strong></h4><p>Смолы эпоксидные модифицированные марок КДА, КДА-2 ТУ 2225-019-75678843-2010 предназначены для использования в качестве связующего для стеклопластиков, клеев и электроизоляционных заливочных композиций.</p><p>МЕРЫ ПРЕДОСТОРОЖНОСТИ:</p><p>Работающие с эпоксидными смолами должны быть обеспечены спецодеждой и индивидуальными средствами защиты. Все операции при работе с эпоксидными смолами должны проводится в помещениях оборудованных приточно-вытяжной вентиляцией.</p><p>ХРАНЕНИЕ: Эпоксидные смолы модифицированные марок КДА, КДА-2 хранят в плотно закрытой таре в закрытых складских помещениях при температуре не выше 30&nbsp;<sup>0</sup>С.</p><p>ФАСОВКА: Отгрузка эпоксидных смол производится в стальных бочках. Также возможна фасовка эпоксидной смолы в пластиковую тару по 0,5 кг.</p><p><em>Гарантийный срок хранения 12 месяцев со дня изготовления.</em></p>', 'Эпоксидные смолы КДА, КДА-2', 'Эпоксидные смолы КДА, КДА-2', 5),
(27, 'Натр едкий очищенный (гидроксид натрия) (Россия)', '<p>GOST 11078-78</p><h6>Назначение</h6><p class=\"ql-align-justify\">Марка А применяется в производстве химических волокон, ионообменных смол, реактивов, в медицинской промышленности. Марка Б применяется в производстве непищевой целлюлозной пленки, чистых металлов, в целлюлозно-бумажной промышленности, для производства минеральных удобрений.</p><h6>Транспортировка</h6><p>Железнодорожным и автомобильным транспортом.</p><h6>Упаковка</h6><p class=\"ql-align-justify\">В ж/д цистерны, контейнеры, бочки или мелкую тару из стали марки Х18Н10Т или стали углеродистой гуммированной поверхностью или из полиэтилена.</p>', 'Натр едкий очищенный (гидроксид натрия)', 'Натр едкий очищенный, гидроксид натрия', 12),
(28, 'Натр едкий технический (гидроксид натрия, сода каустическая) (Россия)', '<p>GOST P 55064-2012</p><h6>Назначение</h6><p class=\"ql-align-justify\">Применяется в процессах органического синтеза, при очистке нефтепродуктов, в текстильной промышленности в производстве вискозного шелка и при отбеливании тканей, в бумажной и анилинокрасочной промышленности, мыловарении, в производстве алюминия и металлического натрия, растворимого стекла, щелочных аккумуляторов, Трилона Б.</p><h6>Транспортировка</h6><p>Железнодорожным и автомобильным транспортом.</p><h6>Упаковка</h6><p>Марка РД – в ж/д цистернах.</p>', 'Натр едкий технический (гидроксид натрия, сода каустическая)', 'Натр едкий технический, гидроксид натрия, сода каустическая', 12),
(29, 'Натр едкий технический чешуированный (Россия)', '<p>STO 00203312-017-2011</p><h6>Назначение</h6><p class=\"ql-align-justify\">Применяется в процессах органического синтеза, при очистке нефтепродуктов, в текстильной промышленности в производстве вискозного шелка и при отбеливании тканей, в бумажной и анилинокрасочной промышленности, мыловарении, в производстве алюминия и металлического натрия, растворимого стекла, щелочных аккумуляторов, Трилона Б.</p><h6>Транспортировка</h6><p>Железнодорожным и автомобильным транспортом.</p><h6>Упаковка</h6><p class=\"ql-align-justify\">Стальные барабаны по ГОСТ 5044, исполнения Б и В, вместимостью 25–250 дм3, навивные картонные барабаны по ГОСТ 17065 типа I или II, вместимостью 25–100 дм3&nbsp;мешками-вкладышами из полиэтиленовой пленки толщиной не менее 0,1 мм; в специализированные мягкие контейнеры типа МКР-1, ОС-1, ЗППР по ТУ 2297-076-00209728-99 с полиэтиленовыми вкладышами; в мешки полипропиленовые (полимерные) типа МП-2 по ТУ 2297-001-00204688-2000; в полиэтиленовые бочки по ТУ 2297-001-54011141-01; в полиэтиленовые мешки с закрытой горловиной по ГОСТ 17811. Масса нетто едкого натра в полиэтиленовом мешке – не более 50 кг, в мягком контейнере – не более 1 300 кг; в полиэтиленовых бочках – не более 60 кг, в полимерных мешках – не более 50 кг.</p>', 'Натр едкий технический чешуированный', 'Натр едкий технический чешуированный', 12),
(30, 'Сода кальцинированная (Россия)', '<p>GOST 5100-85</p><h6>Назначение</h6><p class=\"ql-align-justify\">Сода кальцинированная марок А и Б используется в производстве стекла всех видов, в том числе: хрусталя, оптического и медицинского стекла, стеклоблоков, пеностекла, силиката натрия растворимого, керамических плиток, компонента фритт для глазурей; в черной и цветной металлургии: для производства свинца, цинка, вольфрама, стронция, хрома, для десульфуризации и дефосфации чугуна, в очистке отходящих газов, для нейтрализации сред.</p><p class=\"ql-align-justify\">Сода кальцинированная марки Б применяется в химической промышленности для производства синтетических моющих средств и жирных кислот, при очистке рассолов, в производстве фосфорных, хромовых, бариевых, натриевых солей как карбонатсодержащее сырье, в производстве глицеринов, аллилового спирта; целлюлозно-бумажной, анилино-красочной, лакокрасочной и нефтяной промышленностях, а также как реагент для обработки питьевой воды.</p><h6>Транспортировка</h6><p class=\"ql-align-justify\">Соду кальцинированную транспортируют насыпью – в содовозах и хопперах, упакованную в мягкие специализированные контейнеры, перевозят по железной дороге в полувагонах и крытых вагонах. Соду кальцинированную, упакованную в мешки, перевозят любым видом транспорта, предохраняя продукт от попадания влаги.</p><h6>Упаковка</h6><p class=\"ql-align-justify\">Соду кальцинированную упаковывают в бумажные и полипропиленовые мешки массой до 50 кг, мягкие специализированные контейнеры разового использования массой до 1 000 кг.</p>', 'Сода кальцинированная', 'Сода кальцинированная', 12),
(31, 'Трихлорэтилен (Китай)', '<p><strong style=\"color: inherit;\"><u>Компания производитель:</u></strong>&nbsp;Befar (Китай)</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p><strong style=\"color: inherit;\"><u>Бесцветная, прозрачная, подвижная, летучая жидкость со своеобразным запахом, напоминающим запах хлороформа. Практически нерастворим в воде, не горюч и не взрывоопасен, смешивается с органическими растворителями.</u></strong></p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li>производство фторуглеродов (ГФУ 134а);</li><li>очищение и обезжиривание металлов, подготовка металлических поверхностей для цинкования, анодного оксидирования, гальванического покрытия, покраски и связывания;</li><li>растворитель для масел и жиров;</li><li>наркозное средство;</li><li>обработка тканей.</li></ul><p><strong style=\"color: inherit;\"><u>Условия хранения:</u></strong></p><p><strong style=\"color: inherit;\"><u>Хранить в холодном, сухом, хорошо проветриваемом помещении, вдали от источников тепла и несовместимых веществ.</u></strong></p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong></p><p><strong style=\"color: inherit;\"><u>Продукт упакован в стальные 200л бочки по 300 кг нетто, по желанию заказчика может быть поставлен в пластиковых бочках и канистрах, а также в танк-контейнерах</u></strong></p><p><strong style=\"color: inherit;\"><u>Номер UN 1710</u></strong></p><p><strong style=\"color: inherit;\"><u>Класс опасности 6.1</u></strong></p><p><strong style=\"color: inherit;\"><u>Группа упаковки III</u></strong></p>', 'Трихлорэтилен (Китай)', 'Трихлорэтилен', 7),
(32, 'Трихлорэтилен (Индия)', '<p><strong style=\"color: inherit;\"><u>Компания производитель:</u></strong>&nbsp;Индия</p><p><strong style=\"color: inherit;\"><u>Описание продукта:</u></strong></p><p>Бесцветная, прозрачная, подвижная, летучая жидкость со своеобразным запахом, напоминающим запах хлороформа. Практически нерастворим в воде, не горюч и не взрывоопасен, смешивается с органическими растворителями.</p><p><strong style=\"color: inherit;\"><u>Применение продукта:</u></strong></p><ul><li>производство фторуглеродов (ГФУ 134а);</li><li>очищение и обезжиривание металлов, подготовка металлических поверхностей для цинкования, анодного оксидирования, гальванического покрытия, покраски и связывания;</li><li>растворитель для масел и жиров;</li><li>наркозное средство;</li><li>обработка тканей.</li></ul><p><strong style=\"color: inherit;\"><u>Условия хранения:</u></strong></p><p>Хранить в холодном, сухом, хорошо проветриваемом помещении, вдали от источников тепла и несовместимых веществ.</p><p><strong style=\"color: inherit;\"><u>Упаковка и информация для транспортировки:</u></strong></p><p>Продукт упакован в стальные 200л бочки по 300 кг нетто, по желанию заказчика может быть поставлен в пластиковых бочках и канистрах, а также в танк-контейнерах</p><p>Номер UN 1710</p><p>Класс опасности 6.1</p><p>Группа упаковки III</p>', 'Трихлорэтилен (Индия)', 'Трихлорэтилен', 6),
(33, 'Аммоний хлористый технический (порошок) (Китай)', '', 'Аммоний хлористый технический', 'Аммоний хлористый технический', 8),
(34, 'Аммоний хлористый технический (гранулы) (Китай)', '', 'Аммоний хлористый технический', 'Аммоний хлористый технический', 8),
(35, 'Сульфат аммония (Россия)', '', 'Сульфат аммония', 'Сульфат аммония', 14),
(36, 'Карбамид марки Б (Россия)', '', 'Карбамид марки Б', 'Карбамид марки Б', 15),
(37, 'Пеногаситель силиконовый ПС-1 марка А (эмульсия) (Россия)', '', 'Пеногаситель силиконовый', 'Пеногаситель силиконовый', 10),
(38, 'Пеногаситель силиконовый ПС-1 марка Б (эмульсия) (Россия)', '', 'Пеногаситель силиконовый', 'Пеногаситель силиконовый', 10),
(39, 'Пеногаситель силиконовый ПС-1П (гранулированный) (Россия)', '', 'Пеногаситель силиконовый', 'Пеногаситель силиконовый', 10),
(40, 'Лауретсульфат натрия SLES 70% (Китай)', '', 'Лауретсульфат натрия', 'Лауретсульфат натрия', 8);

